<script>

function loadValue() {
    var x = document.getElementById("numbertext").value;
    document.getElementById("tspan1").textContent = x + " FOIS";

    var y = document.getElementById("blazetext").value;
    document.getElementById("tspan2").textContent = y + " FOIS";

    for (var i = 1; i <= 18; i += 1) {
      var str = "bibi" + i;
      console.log(str);
      document.getElementById(str).style.display = "none";
    }

    for (var i = 1; i <= x && i <= 18; i += 1) {
      document.getElementById("bibi" + i).style.display = "block";
    }
}

function DownloadAsImage() {
  domtoimage.toBlob(document.getElementById('svg_element'))
    .then(function(blob) {
      window.saveAs(blob, 'Nether.png');
    });
}

</script>
